import React from 'react';

class About extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="w-100 p-5 vh-90" >
         <h2>Hello, Universe!</h2>
         <h1>I'm Goodness, a Front-end Developer</h1>
         <p>I build stunning and business evolving websites. I answer CodeEvolver on my social handles. I'm open to collaborations on any project. I've got great teamwork and efficiency, quality, and problem solving as values</p>
         <button className="btn btn-primary">Get in Touch</button>
      </div>
    );
  }
}

export {About}
